import React, { useState } from "react";
import AbsoluteWrapper from "./AbsoluteWrapper";
import "../css/roadmap.css";

function Roadmap() {
  return (
    <AbsoluteWrapper>
      <div className="roadmapPage">
        <h3>PATH TO INFINITY</h3>
        <div className="allBlocks">
          <div className="community">
            {" "}
            <h4>COMMUNITY</h4>
              <h6>Artist Contests</h6>
              <h6>Artist Collab Spotlights</h6>
              <h6>Community Art Curation Club</h6>
              <h6>Merch & Print Giveaways</h6>
              <h6>Community Spaces</h6>
          </div>

          <div className="sellout">
            {" "}
            <h4>SELLOUT ALLOCATIONS</h4>
          </div>
          <div className="preparation">
            {" "}
            <h4>THE PREPARATION</h4> <h5>Future Utility</h5>
          </div>
          <div className="erad">
            {" "}
            <h4>THE ERADICATION</h4> <h5>Generation 2</h5>
          </div>
        </div>
      </div>
    </AbsoluteWrapper>
  );
}

export default Roadmap;
